import React, { useEffect, useState } from 'react'
import DefaultImage from '../../assets/images/car-image.webp';
import axios from 'axios';
const RatingBox = ({ id }) => {
    const [review, setReview] = useState([]);

    useEffect(() => {
        const fetchReview = async () => {
            try {
                const res = await axios.get(`http://localhost:5000/api/car/${id}/review`);
                setReview(res.data);
            } catch (err) {
                console.log(err);
            }
        };
        fetchReview();
    }, [id]);

    return (
        <div className="relative mb-5 pb-5 border-b border-[#ededed]">
            <div className="flex mb-4 items-center">
                <img src={DefaultImage} alt="" className='rounded-full w-[60px] h-[60px] object-cover mr-5' />
                <div className="flex justify-between -mt-[2px] w-full">
                    <div>
                        <a href="javascript:void(0)" className='text-[18px] font-medium'>Anees Urrehman</a>
                        <div className="text-xs text-[#ff7101] text-[##ff7101] space-y-2">
                            <i className="fa-solid fa-star"></i>
                            <i className="fa-solid fa-star"></i>
                            <i className="fa-solid fa-star"></i>
                            <i className="fa-solid fa-star"></i>
                            <i className="fa-solid fa-star"></i>
                        </div>
                    </div>
                    <span className="text-xs leading-4 text-[#696665]">8 months ago</span>
                </div>
            </div>
            <div className="mb-3">
                <p className="text-sm text-[#696665]">Lorem ipsum dolor sit amet consectetur adipisicing elit. Aliquam earum aut omnis nesciunt.</p>
            </div>
            <button href="javascript:void(0)" className="text-[#ff7101] text-sm">
                <i className="fa-solid fa-pencil mr-[6px] align-middle"></i>
                Edit
            </button>
        </div>
    )
}

export default RatingBox
